import * as d3 from "d3";

function Brokenlinechart(data, {

    width = 800,
    height = 600,
    margin = { top: 40, right: 50, bottom: 60, left: 50 },
    innerWidth = width - margin.left - margin.right,
    innerHeight = height - margin.top - margin.bottom,
} = {}) {

    // 创建SVG
    const svg = d3.select("#svg0")
        .attr("width", width)
        .attr("height", height)
        .attr("style", "width: 100%; height: auto; font: 10px sans-serif;");

    // 创建一个比例尺，将年份映射到X轴上的位置
    const xScale = d3.scaleBand()
        .domain(data.map(d => d.年份))
        .range([0, innerWidth])
        .padding(0.1);

    // 创建一个比例尺，将资源消耗占比映射到Y1轴上的位置
    const y1Scale = d3.scaleLinear()
        .domain([0, d3.max(data, d => Math.max(d.煤炭, d.石油, d.天然气, d.一次电力及其他能源)+10)])
        .range([innerHeight, 0]);

    // 创建一个比例尺，将资源消耗占比映射到Y2轴上的位置
    const y2Scale = d3.scaleLinear()
        .domain([0, d3.max(data, d => Math.max(d.能源消费总量))])
        .range([innerHeight, 0]);


    // 创建一个X轴、Y1轴、Y2轴生成器，用于在SVG中添加这些轴
    const xAxis = d3.axisBottom(xScale);
    const y1Axis = d3.axisLeft(y1Scale);
    const y2Axis = d3.axisRight(y2Scale);

    // 在SVG中添加X轴
    svg.append("g")
        .attr("class", "x-axis")
        .attr("transform", "translate(0," + innerHeight + ")")
        .call(xAxis);

    // 在SVG中添加Y1轴
    svg.append("g")
        .attr("class", "y1-axis")
        .call(y1Axis);

    // 在SVG中添加Y2轴
    svg.append("g")
        .attr("class", "y2-axis")
        .attr("transform", "translate(" + innerWidth + ",0)")
        .call(y2Axis);

    //添加柱状图
    svg.selectAll(".bar")
        .data(data)
        .enter().append("rect")
        .attr("class", "bar")
        .attr("x", function (d) { return xScale(d.年份); })
        .attr("width", xScale.bandwidth())
        .attr("y", function (d) { return y2Scale(d.能源消费总量); })
        .attr("height", function (d) { return innerHeight - y2Scale(d.能源消费总量); })
        .attr("fill", "#5E92CC");

    // 创建煤炭曲线
    const line1 = d3.line()
        .x(d => xScale(d.年份) + xScale.bandwidth() / 2)
        .y(d => y1Scale(d.煤炭))
        .curve(d3.curveBumpX);

    // 创建石油曲线
    const line2 = d3.line()
        .x(d => xScale(d.年份) + xScale.bandwidth() / 2)
        .y(d => y1Scale(d.石油))
        .curve(d3.curveBumpX);

    // 创建天然气曲线
    const line3 = d3.line()
        .x(d => xScale(d.年份) + xScale.bandwidth() / 2)
        .y(d => y1Scale(d.天然气))
        .curve(d3.curveBumpX);

    // 创建一次电力及其他能源曲线
    const line4 = d3.line()
        .x(d => xScale(d.年份) + xScale.bandwidth() / 2)
        .y(d => y1Scale(d.一次电力及其他能源))
        .curve(d3.curveBumpX);

    // 在SVG中绘制煤炭曲线
    svg.append("path")
        .datum(data)
        .attr("fill", "none")
        .attr("stroke", "red")
        .attr("stroke-width", 2.5)
        .attr("d", line1)
        .style("stroke-linejoin", "round") // 设置线段连接处为圆角
        .style("stroke-linecap", "round") // 设置线段末端为圆角
        .transition()
        .duration(1000)
        .attrTween("stroke-dasharray", function () {
            const length = this.getTotalLength();
            return function (t) {
                return d3.interpolateString("0," + length, length + "," + length)(t);
            };
        });

    // 在SVG中绘制石油曲线
    svg.append("path")
        .datum(data)
        .attr("fill", "none")
        .attr("stroke", "blue")
        .attr("stroke-width", 2.5)
        .attr("d", line2)
        .style("stroke-linejoin", "round") // 设置线段连接处为圆角
        .style("stroke-linecap", "round") // 设置线段末端为圆角
        .transition()
        .duration(1000)
        .attrTween("stroke-dasharray", function () {
            const length = this.getTotalLength();
            return function (t) {
                return d3.interpolateString("0," + length, length + "," + length)(t);
            };
        });

    // 在SVG中绘制天然气曲线
    svg.append("path")
        .datum(data)
        .attr("fill", "none")
        .attr("stroke", "orange")
        .attr("stroke-width", 2.5)
        .attr("d", line3)
        .style("stroke-linejoin", "round") // 设置线段连接处为圆角
        .style("stroke-linecap", "round") // 设置线段末端为圆角
        .transition()
        .duration(1000)
        .attrTween("stroke-dasharray", function () {
            const length = this.getTotalLength();
            return function (t) {
                return d3.interpolateString("0," + length, length + "," + length)(t);
            };
        });

    // 在SVG中绘制一次电力及其他能源曲线
    svg.append("path")
        .datum(data)
        .attr("fill", "none")
        .attr("stroke", "green")
        .attr("stroke-width", 2.5)
        .attr("d", line4)
        .style("stroke-linejoin", "round") // 设置线段连接处为圆角
        .style("stroke-linecap", "round") // 设置线段末端为圆角
        .transition()
        .duration(1000)
        .attrTween("stroke-dasharray", function () {
            const length = this.getTotalLength();
            return function (t) {
                return d3.interpolateString("0," + length, length + "," + length)(t);
            };
        });

    // 绘制煤炭数据点
    svg.selectAll(".data-point-煤炭")
        .data(data)
        .enter()
        .append("circle")
        .attr("class", "data-point-煤炭")
        .attr("cx", d => xScale(d.年份) + xScale.bandwidth() / 2)
        .attr("cy", d => y1Scale(d.煤炭))
        .attr("r", 0)
        .style("fill", "red") // 设置填充颜色为红色
        .on("mouseover", function () {
            d3.select(this)
                .transition()
                .attr("r", 6);
        })
        .on("mouseout", function () {
            d3.select(this)
                .transition()
                .attr("r", 4);
        })
        .transition()
        .delay(1000)
        .duration(500)
        .attr("r", 4);

    // 绘制石油数据点
    svg.selectAll(".data-point-石油")
        .data(data)
        .enter()
        .append("circle")
        .attr("class", "data-point-石油")
        .attr("cx", d => xScale(d.年份) + xScale.bandwidth() / 2)
        .attr("cy", d => y1Scale(d.石油))
        .attr("r", 0)
        .style("fill", "blue") // 设置填充颜色为蓝色
        .on("mouseover", function () {
            d3.select(this)
                .transition()
                .attr("r", 6);
        })
        .on("mouseout", function () {
            d3.select(this)
                .transition()
                .attr("r", 4);
        })
        .transition()
        .delay(1000)
        .duration(500)
        .attr("r", 4);

    // 绘制天然气数据点
    svg.selectAll(".data-point-天然气")
        .data(data)
        .enter()
        .append("circle")
        .attr("class", "data-point-天然气")
        .attr("cx", d => xScale(d.年份) + xScale.bandwidth() / 2)
        .attr("cy", d => y1Scale(d.天然气))
        .attr("r", 0)
        .style("fill", "orange") // 设置填充颜色为橙色
        .on("mouseover", function () {
            d3.select(this)
                .transition()
                .attr("r", 6);
        })
        .on("mouseout", function () {
            d3.select(this)
                .transition()
                .attr("r", 4);
        })
        .transition()
        .delay(1000)
        .duration(500)
        .attr("r", 4);

    // 绘制一次电力及其他能源数据点
    svg.selectAll(".data-point-一次电力及其他能源")
        .data(data)
        .enter()
        .append("circle")
        .attr("class", "data-point-一次电力及其他能源")
        .attr("cx", d => xScale(d.年份) + xScale.bandwidth() / 2)
        .attr("cy", d => y1Scale(d.一次电力及其他能源))
        .attr("r", 0)
        .style("fill", "green") // 设置填充颜色为绿色
        .on("mouseover", function () {
            d3.select(this)
                .transition()
                .attr("r", 6);
        })
        .on("mouseout", function () {
            d3.select(this)
                .transition()
                .attr("r", 4);
        })
        .transition()
        .delay(1000)
        .duration(500)
        .attr("r", 4);

    // 添加煤炭标签
    svg.selectAll(".data-label-煤炭")
        .data(data)
        .enter()
        .append("text")
        .attr("class", "data-label-煤炭")
        .attr("x", d => xScale(d.年份) + xScale.bandwidth() / 2)
        .attr("y", d => y1Scale(d.煤炭) - 10)
        .text(d => d.煤炭)
        .style("text-anchor", "middle")
        .style("opacity", 0)
        .transition()
        .delay(1000)
        .duration(500)
        .style("opacity", 1);

    // 添加石油标签
    svg.selectAll(".data-label-石油")
        .data(data)
        .enter()
        .append("text")
        .attr("class", "data-label-石油")
        .attr("x", d => xScale(d.年份) + xScale.bandwidth() / 2)
        .attr("y", d => y1Scale(d.石油) + 15)
        .text(d => d.石油)
        .style("text-anchor", "middle")
        .style("opacity", 0)
        .transition()
        .delay(1000)
        .duration(500)
        .style("opacity", 1);

    // 添加天然气标签
    svg.selectAll(".data-label-天然气")
        .data(data)
        .enter()
        .append("text")
        .attr("class", "data-label-天然气")
        .attr("x", d => xScale(d.年份) + xScale.bandwidth() / 2)
        .attr("y", d => y1Scale(d.天然气) - 10)
        .text(d => d.天然气)
        .style("text-anchor", "middle")
        .style("opacity", 0)
        .transition()
        .delay(1000)
        .duration(500)
        .style("opacity", 1);

    // 添加一次电力及其他能源标签
    svg.selectAll(".data-label-一次电力及其他能源")
        .data(data)
        .enter()
        .append("text")
        .attr("class", "data-label-一次电力及其他能源")
        .attr("x", d => xScale(d.年份) + xScale.bandwidth() / 2)
        .attr("y", d => y1Scale(d.一次电力及其他能源) + 15)
        .text(d => d.一次电力及其他能源)
        .style("text-anchor", "middle")
        .style("opacity", 0)
        .transition()
        .delay(1000)
        .duration(500)
        .style("opacity", 1);

    // 添加数据点和标签的鼠标交互
    svg.selectAll(".data-point-煤炭, .data-point-石油,.data-point-天然气, .data-point-一次电力及其他能源")
        .on("mouseover", function () {
            d3.select(this)
                .transition()
                .attr("r", 6);
        })
        .on("mouseout", function () {
            d3.select(this)
                .transition()
                .attr("r", 4);
        });

    return svg.node();

}

export default Brokenlinechart;
